  width: 47px;
  height: 47px;
  object-fit: cover;
`;

const Groupe2060 = styled.div`
  width: 1056px;
  z-index: 2;
  align-self: center;
  margin-top: 186px;
  margin-left: 190px;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  min-height: 1239px;
`;

const Groupe1992 = styled.div`
  width: 1056px;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  min-height: 744px;
`;

const EnQuelleTerminaleTesVous = styled.div`
  ${HeeboBoldBlack35px}
  width: 736px;
  height: 107px;
  margin-top: -2px;
  align-self: center;
  margin-left: 82px;
  text-align: center;
  letter-spacing: 0;
  line-height: 40px;
`;

const GnraleSlectionn = styled.div`
  ${SegoeuiLightBlack25px}
  width: 384px;
  height: 107px;
  margin-top: 36px;
  letter-spacing: 0;
  line-height: 25px;
`;

const Groupe2058 = styled.div`
  height: 314px;
  margin-top: 51px;
  display: flex;
  align-items: flex-start;
  min-width: 1056px;
`;

const ComposantContainer = styled.div`
  width: 332px;
  position: relative;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  min-height: 314px;
`;

const ComposantContainer1 = styled.div`
  width: 332px;
  position: relative;
  margin-left: 30px;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  min-height: 314px;
`;

const Groupe1968 = styled.div`
  ${Border1pxFf5d22}
  height: 64px;
  margin-top: 68px;
  display: flex;
  padding: 0 68px;
  justify-content: flex-end;
  align-items: center;
  min-width: 332px;
  background-color: var(--white);
  border-radius: 18px;
  cursor: pointer;
`;

const JeValideMaSlection = styled.div`
  ${SegoeuiRegularNormalDoveGray20px}
  width: 195px;
  height: 34px;
  letter-spacing: 0;
  line-height: 20px;
`;

const Technologique = styled.div`
  ${SegoeuiLightBlack25px}
  width: 384px;
  height: 40px;
  margin-top: 23px;
  margin-left: 10px;
  letter-spacing: 0;
  line-height: 25px;
`;

const Groupe2059 = styled.div`
  width: 1056px;
  margin-top: 67px;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  min-height: 365px;
`;

const GroupeContainer = styled.div`
  position: relative;
  display: flex;
  align-items: flex-start;
  min-width: 1056px;
`;

const Groupe2042 = styled.div`
  width: 332px;
  height: 148px;
  position: relative;
  display: flex;
  flex-direction: column;
